Writer:  Joe Kelly
Pencilers:  Pasqual Ferry (#803-805) and Jason Pearson (#805)
Inker:  Cam Smith
Colorist:  Guy Major
Letterer:  Comicraft
Cover:  Dave Bullock

Action Comics v1 #803
Superman returns from the sun, ready to declare war on those plotting against America. Meanwhile, Lex Luthor creates his own forces from the inmates stranded on the orbital prison of Stryker's Island. &quot;The Harvest&quot; part 2.

Action Comics v1 #804
Jailbreak! Superman and Lex Luthor team up to get the inmates from the orbiting Stryker's Island asteroid prison and use them as an army against the factions of General Zod. &quot;The Harvest&quot; part 3.

Action Comics v1 #805
This is it: the final battle between Superman and General Zod! Who will reign supreme? There can be only one winner...and Lex Luthor is looking to fix the outcome! &quot;The Harvest&quot; part 4.

Thanks goes to DreamGirl for this release.

